    @staticmethod
    def _get_market_indicator() -> pd.DataFrame:
        """
        获取中国市场的主要参考数据指标，数据的跨度为 (1990-12-19 to now)

        目前包括的数据有：
            上证综指，深成指 ： 开高低收量额涨跌幅等
            上证行业相关指数： 上证能源,上证材料,上证工业,上证可选,上证消费,上证医药,上证金融,上证信息,上证电信,上证公用
                            取 开高低收量额涨跌幅等
            上海/深圳市场的融资余额： 融资（券）余额，融资买入额，融资偿还额，融券卖出量，融券余量，融资融券余额
            美元与主要货币对的汇率： 英镑美元,欧元美元,美元人民币,美元日元,澳元美元,美元加元,美元瑞郎,美元港元,美元墨西哥比索,美元挪威克朗,美元瑞典克朗,美元土耳其里拉,美元南非兰特,新西兰元美元
            shibor : 'on', '1w', '2w', '1m', '3m', '6m', '9m', '1y'
            温州民间借贷利率： 不同期限以及不同放款人（小额贷款公司，民间借贷服务中心，民间资本管理公司，农村互助会 等）
        上述数据，最终都跟 上证综指数据做 left join
        """
        from gs_research_workflow.time_series.data.yfinance_wrapper import yFinanceData
        from gs_research_workflow.time_series.data.tushare_wrapper import TuShareProData
        ts_wrapper = TuShareProData(use_l3_cache=True)
        yahoo = yFinanceData(use_l3_cache=True)
        # 上证综指
        df_sh000001_index = ts_wrapper.index_quotation_daily("000001.SH", cols=['close', 'open', 'high', 'low',
                                                                                'pre_close', 'change', 'pct_chg', 'vol',
                                                                                'amount'])
        # 深证成指
        df_sz000001_index = ts_wrapper.index_quotation_daily("399001.SZ", cols=['close', 'open', 'high', 'low',
                                                                                'pre_close', 'change', 'pct_chg', 'vol',
                                                                                'amount'])
        df_whole_mkt_indicator = df_sh000001_index.join(df_sz000001_index, how="left", lsuffix="_000001.SH",
                                                        rsuffix="_399001.SZ")

        # 一些行业类的指数，选用收盘价的数据，沪深数据趋同，这里就只选取沪市的数据作为基准
        # 分别为：上证能源,上证材料,上证工业,上证可选,上证消费,上证医药,上证金融,上证信息,上证电信,上证公用
        ls_sh_industry_index_code = ["000032.SH", "000033.SH", "000034.SH", "000035.SH", "000036.SH", "000037.SH",
                                     "000038.SH", "000039.SH", "000040.SH", "000041.SH"]
        for index_code in ls_sh_industry_index_code:
            df = ts_wrapper.index_quotation_daily(index_code, cols=['close', 'open', 'high', 'low',
                                                                    'pre_close', 'change', 'pct_chg', 'vol',
                                                                    'amount'])
            df_whole_mkt_indicator = df_whole_mkt_indicator.join(df, how="left", rsuffix=f"_{index_code}")

        # 上海(深圳)市场的融资余额
        for mkt_code in ["SSE", "SZSE"]:
            df = ts_wrapper.margin(mkt_code, cols=['rzye', 'rzmre', 'rzche', 'rqye', 'rqmcl', 'rzrqye'])
            df_whole_mkt_indicator = df_whole_mkt_indicator.join(df, how="left", rsuffix=f"_{mkt_code}_margin")

        # 美元与主要货币对的汇率
        # 包括：英镑美元,欧元美元,美元人民币,美元日元,澳元美元,美元加元,美元瑞郎,美元港元,美元墨西哥比索,美元挪威克朗,美元瑞典克朗,美元土耳其里拉,美元南非兰特,新西兰元美元
        ls_fx_code = ["GBPUSD.FXCM", "EURUSD.FXCM", "USDCNH.FXCM", "USDJPY.FXCM", "AUDUSD.FXCM", "USDCAD.FXCM",
                      "USDCHF.FXCM", "USDHKD.FXCM", "USDMXN.FXCM", "USDNOK.FXCM", "USDSEK.FXCM", "USDTRY.FXCM",
                      "USDZAR.FXCM", "NZDUSD.FXCM"]
        for fx_code in ls_fx_code:
            df = ts_wrapper.fx_daily(ts_code=fx_code,
                                     cols=['bid_open', 'bid_close', 'bid_high', 'bid_low', 'ask_open', 'ask_close',
                                           'ask_high', 'ask_low', 'tick_qty'])
            df_whole_mkt_indicator = df_whole_mkt_indicator.join(df, how="left", rsuffix=f"_{fx_code}")

        # shibor
        df_shibor = ts_wrapper.shibor(cols=['on', '1w', '2w', '1m', '3m', '6m', '9m', '1y'])
        df_whole_mkt_indicator = df_whole_mkt_indicator.join(df_shibor, how="left", rsuffix=f"_shibor")

        # wz_index
        df_wz_index = ts_wrapper.wz_index(cols=['comp_rate', 'center_rate', 'micro_rate', 'cm_rate', 'sdb_rate',
                                                'om_rate', 'aa_rate', 'm1_rate', 'm3_rate', 'm6_rate', 'm12_rate',
                                                'long_rate'])
        df_whole_mkt_indicator = df_whole_mkt_indicator.join(df_wz_index, how="left", rsuffix="_wzindex")

        # 美国指数，取 NASDAQ Composite ， NYSE , s&p500 , Dow Jones Industrial Average ,
        us_index_symbols = ["^IXIC", "^NYA", "^GSPC", "^DJI"]
        for index_code in us_index_symbols:
            # 美国市场比国内晚一天，所以 lag 一下
            df = yahoo.history(index_code, cols=['Open', 'High', 'Low', 'Close', 'Volume']).shift(periods=1)
            df_whole_mkt_indicator = df_whole_mkt_indicator.join(df, how="left", rsuffix=f"_{index_code}")
        return df_whole_mkt_indicator

    @property
    def market_indicator(self) -> pd.DataFrame:
        if hasattr(self, "_market_indicator"):
            return self._market_indicator
        # 为了加快调试时的速度，这里每天产生一个缓存文件
        cache_file = os.path.join("/tmp", f"mkt_indicator_cache_{datetime.today().strftime('%Y%m%d')}.pkl")
        if os.path.isfile(cache_file):
            self._market_indicator = pd.read_pickle(cache_file, compression="gzip")
        else:
            self._market_indicator = TSPortfolioWeightInputStep._get_market_indicator()
            self._market_indicator.to_pickle(cache_file, compression="gzip", protocol=4)
        return self._market_indicator

